    <div class="navbar-nav">
    <Link className="text-white" to="/App">Tennis App  </Link>
        <Link onClick={this.handleLogout} className="text-white"  to="/">{this.context.user && this.context.user.name}</Link>
        <Link onClick={this.handleLogout} className="text-white mr-sm-2"  to="/">Exit</Link>

    </div>
  </div>
</nav>
